  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for the La
  Crosse District of Upper Mississippi River National Wildlife and Fish Refuge summarizes
  Refuge activities during the 2002 fiscal year.  The report begins with an introduction
  to the Refuge and a summary of the yearu2019s highlights and climatic conditions.
  \ Information about monitoring and studies- including surveys and censuses- is provided
  next.  Habitat restoration and management projects are also covered; activities
  include water level management, grazing, timber management, fire management, and
  vegetation control.  Fish and wildlife management is discussed next with emphasis
  on bird banding, disease monitoring, and invasive animal management.  Coordination
  activities, such as interagency coordination and private land activities, are outlined.
  \ The resource protection section provides information about law enforcement, permits,
  contaminant investigation, and land acquisition.  Information about public education
  and recreation is given including visitor services and outreach.  Finally, Refuge
  planning and administration- including Comprehensive Conservation Planning and general
  administration- are discussed; Refuge brochures are attached.\",\n\t\"license_title\":
